function initAnimation () {
	canvas = document.getElementById("game_canvas");

	var config = { alpha: false, antialias: true };
	gl = canvas.getContext("webgl", config);
	if (!gl) {
		alert('WebGL is unavailable.');
		return;
	}
	
	// Create a simple shader, mesh, model-view-projection matrix and SkeletonRenderer.
	shader = spine.Shader.newTwoColoredTextured(gl);
	batcher = new spine.PolygonBatcher(gl);

	skeletonRenderer = new spine.SkeletonRenderer(gl);
	
	shapes = new spine.ShapeRenderer(gl);
	assetManager = new spine.AssetManager(gl);

	// Tell AssetManager to load the resources for each model, including the exported .skel file, the .atlas file and the .png
	// file for the atlas. We then wait until all resources are loaded in the load() method.
	
	assetManager.setRawDataURI("03_Dresses.png",BackPngCode);
	assetManager.setRawDataURI("03_Dresses.json",BackJsonFileTxt);
	assetManager.setRawDataURI("03_Dresses.atlas",BackAtlasStr);
	
	assetManager.loadText("03_Dresses.json");
	assetManager.loadTextureAtlas("03_Dresses.atlas");
	
	requestAnimationFrame(load);
}

var AnimationsQueue = [];

function loadSkeleton (name, initialAnimation, premultipliedAlpha, nameMain, skin) {
	if (skin === undefined) skin = "default";

	// Load the texture atlas using name.atlas from the AssetManager.
	
	var atlas = assetManager.get(nameMain+".atlas");

	// Create a AtlasAttachmentLoader that resolves region, mesh, boundingbox and path attachments
	var atlasLoader = new spine.AtlasAttachmentLoader(atlas);

	// Create a SkeletonBinary instance for parsing the .skel file.
	var skeletonBinary = new spine.SkeletonBinary(atlasLoader);

	// Set the scale to apply during parsing, parse the file, and create a new skeleton.
	var skeletonJson = new spine.SkeletonJson(atlasLoader);
	
	// Set the scale to apply during parsing, parse the file, and create a new skeleton.
	var skeletonData = skeletonJson.readSkeletonData(assetManager.get(nameMain+".json"));
	var skeleton = new spine.Skeleton(skeletonData);
	skeleton.setSkinByName(skin);
	var bounds = calculateBounds(skeleton);

	// Create an AnimationState, and set the initial animation in looping mode.
	var animationStateData = new spine.AnimationStateData(skeleton.data);
	var animationState = new spine.AnimationState(animationStateData);
	animationState.setAnimation(0, initialAnimation, true);
	animationState.addListener({
		start: function(track) {
			console.log("Animation on track " + track.trackIndex + " started");
		},
		interrupt: function(track) {
			console.log("Animation on track " + track.trackIndex + " interrupted");
		},
		end: function(track) {
			console.log("Animation on track " + track.trackIndex + " ended");
		},
		disposed: function(track) {
			console.log("Animation on track " + track.trackIndex + " disposed");
		},
		complete: function(track) {
			console.log("Animation on track " + track.trackIndex + " completed");
			if (AnimationsQueue.length > 0)
			{
				var i = AnimationsQueue.shift();
				console.log("Start next anim from queue " + i);
				startAnimation(i, true);
			}
		},
		event: function(track, event) {
			console.log("Event on track " + track.trackIndex + ": " + JSON.stringify(event));
		}
	});

	// Pack everything up and return to caller.
	return { skeleton: skeleton, state: animationState, bounds: bounds, premultipliedAlpha: premultipliedAlpha };
}

var DefaultCanvasSizeX = 1920;
var DefaultCanvasSizeY = 1080;

function load () {
	
	if (assetManager.isLoadingComplete()) {
		skeletons[activeSkeleton] = loadSkeleton("skeleton", LastAnim, false, "03_Dresses");

		DefaultCanvasSizeX = skeletons[activeSkeleton].skeleton.data.width;
		DefaultCanvasSizeY = skeletons[activeSkeleton].skeleton.data.height;
		
		lastFrameTime = Date.now() / 1000;
		bLoadedSkeletons = true;
		resize();
		requestAnimationFrame(render);
	} else {
		requestAnimationFrame(load);
	}
}

function calculateBounds(skeleton) {
	skeleton.setToSetupPose();
	skeleton.updateWorldTransform(spine.Physics);
	var offset = new spine.Vector2();
	var size = new spine.Vector2();
	skeleton.getBounds(offset, size, []);
	return { offset: offset, size: size };
}

function render () {
	
	var now = Date.now() / 1000;
	var delta = now - lastFrameTime;
	lastFrameTime = now;

	// Update the MVP matrix to adjust for canvas size changes
	resize();

	gl.clearColor(0.8, 0.8, 0.8, 1.0);
	gl.clear(gl.COLOR_BUFFER_BIT);

	// Apply the animation state based on the delta time.
	
	for (const [key, value] of Object.entries(skeletons)) {
		var state = value.state;
		var skeleton = value.skeleton;
		var bounds = value.bounds;
		var premultipliedAlpha = value.premultipliedAlpha;
		state.update(delta);
		state.apply(skeleton);
		skeleton.updateWorldTransform(spine.Physics);
		
		// Bind the shader and set the texture and model-view-projection matrix.
		shader.bind();
		shader.setUniformi(spine.Shader.SAMPLER, 0);
		shader.setUniform4x4f(spine.Shader.MVP_MATRIX, mvp.values);
		
		// Start the batch and tell the SkeletonRenderer to render the active skeleton.
		batcher.begin(shader);
		
		skeletonRenderer.vertexEffect = null;
		
		skeletonRenderer.premultipliedAlpha = premultipliedAlpha;
		skeletonRenderer.draw(batcher, skeleton);
		batcher.end();
		
		shader.unbind();
	}
	
	gl.clearColor(1, 1, 1, 1);
	gl.colorMask(false, false, false, true);
	gl.clear(gl.COLOR_BUFFER_BIT);
	gl.colorMask(true, true, true, true);

	// draw debug information

	requestAnimationFrame(render);
}

var ClickState = "";

function resize () {
	if (!bLoadedSkeletons)
		return;

	var CanvasWidth = canvas.clientWidth;
	var CanvasHeight = canvas.clientHeight;

	var defMult = DefaultCanvasSizeX / DefaultCanvasSizeY;
	var curMult = CanvasWidth / CanvasHeight;
	
	var canvasxOffset = 0;
	var canvasyOffset = 0;
	
	var newCWidth = DefaultCanvasSizeX;
	var newCHeight = DefaultCanvasSizeY;
	
	if (curMult < defMult)
	{
		var YMult = CanvasHeight / CanvasWidth;
		newCWidth = DefaultCanvasSizeY / YMult;
		canvasxOffset = (DefaultCanvasSizeX - newCWidth) / 2;
	}
	else
	{
		var XMult = CanvasWidth / CanvasHeight;
		newCHeight = DefaultCanvasSizeX / XMult;
		canvasyOffset = 0;//(DefaultCanvasSizeY - newCHeight) / 2;
	}
	
	canvas.width  = newCWidth;
	canvas.height = newCHeight;
	
	mvp.ortho2d(canvasxOffset, canvasyOffset, newCWidth, newCHeight);
	gl.viewport(0, 0, newCWidth, newCHeight);
	
	var slots = skeletons[activeSkeleton].skeleton.slots;
	
	var XWorldMult = canvas.clientWidth / newCWidth;
	var YWorldMult = canvas.clientHeight / newCHeight;
	
	for (let i = 0; i < slots.length; i++) {
		var checkSlot = slots[i];
		var checkBone = checkSlot.bone;
	
		var boneName = checkSlot.data.name;
		
		if (boneName == "panel" || boneName == "panel2" || boneName == "btn_01")
		{
			var ElWidth = checkSlot.attachment.width;
			var ElHeight = checkSlot.attachment.height;
		
			var rootX = checkBone.worldX + checkSlot.attachment.x;
			var rootY = checkBone.worldY + checkSlot.attachment.y;

			var useChildID = "second_lock";
			
			if (boneName == "panel")
				useChildID = "first_lock";
				
			if (boneName == "btn_01")
				useChildID = "play_btn";
			
			var align_element = document.getElementById(useChildID);
			
			if (align_element != null)
			{
				var NewElWidth = ElWidth * checkBone.scaleX;
				var NewElHeight = ElHeight * checkBone.scaleY;
			
				align_element.style.width =  NewElWidth * XWorldMult + 'px';
				align_element.style.height = NewElHeight * YWorldMult + 'px';
				
				var xAddOffset = NewElWidth / 2;
				var yAddOffset = NewElHeight / 2;
			
				align_element.style.left = (Math.round(rootX) - canvasxOffset - xAddOffset) * XWorldMult  +'px';
				align_element.style.top = canvas.clientHeight - (Math.round(rootY) - canvasyOffset + yAddOffset) * YWorldMult  + 'px';
				
				if (checkSlot.color.a < 0.9)
					align_element.style.display = "none";
				else
				{
					if (align_element.style.display != "block")
					{
						console.log("block style applied for " + useChildID)
						align_element.style.display = "block";
					}
				}
			}
		}	
	}
}

function onLockClick(lockID) {
	if (ClickState.length == "2")
		return;

	ClickState = ClickState + lockID;
	console.log("lock " + lockID + " clicked");

	if (ClickState.length == "2")
	{
		console.log("complete event call");
		parent.postMessage('complete','*');
	}

	var StartAnimation = GetAnimationByState();
	startAnimation(StartAnimation, false);
	LastAnim = StartAnimation;
}

function GetAnimationByState()
{
	if (ClickState == "1")
		return "animation_02,animation_02_2";
	
	if (ClickState == "11")
		return "animation_05,animation_03_2";
		
	if (ClickState == "111")
		return "none";
		
	if (ClickState == "112")
		return "none";
		
	if (ClickState == "12")
		return "animation_06,animation_04_2";
			
	if (ClickState == "121")
		return "none";
		
	if (ClickState == "122")
		return "none";
	
	if (ClickState == "2")
		return "animation_01,animation_01_2";
	
	if (ClickState == "21")
		return "animation_03,animation_03_2";
		
	if (ClickState == "211")
		return "none";
		
	if (ClickState == "212")
		return "none";
		
	if (ClickState == "22")
		return "animation_04,animation_04_2";
			
	if (ClickState == "221")
		return "none";
		
	if (ClickState == "222")
		return "none";
		
	return LastAnim;
}

function startAnimation(animationName, animationLoop)
{
	if (animationName == "none")
	{
		document.getElementById("first_lock").addEventListener("click", function() {
		});
		document.getElementById("second_lock").addEventListener("click", function() {
		});
		return;
	}

	if (animationName == "finish_link")
	{
		try {
		  console.log("download event call");
		  parent.postMessage('download','*');
		} catch (error) {
		  console.log("no mraid found");
		  window.open(OpenLink,"_self");
		}
		return;
	}

	if (animationName == "")
		return;
	
	var Anims = animationName.split(",");
	
	for (let i = 0; i < Anims.length; i++) {
		if (i == 0)
			skeletons["back"].state.setAnimation(0, Anims[i], animationLoop);
		else
			AnimationsQueue.push(Anims[i]);
	}
}
